VENTILADOR DE PAREDE // MARCA(S)/MODELO(S) DE REFERÊNCIA:  QUALITAS/Q600P; VENTISOL/NEW 60CM; SOLASTER/ ACAPULCO PLUS.  CARACTERÍSTICA(S): 
- para fixação na parede; 
- oscilante;
- com regulagem de inclinação;
- com controlador de velocidade incluso;
- hélice de três pás, pelo menos;
- com grade metálica;
- vazão de 0,9 m³/h ou superior;
- potência elétrica de, no mínimo, 100W.  MEDIDA(S):  grade com diâmetro de aproximadamente 60 cm.  COR(ES):  preta, preferencialmente.  TENSÃO/FREQUÊNCIA:  220 VAC/60 Hz, direta (sem uso de transformador), com tomada compatível com normas brasileiras.  GARANTIA MÍNIMA:  12 (doze) meses, contados da data do recebimento definitivo.  ACONDICIONAMENTO:  embalagem original de fábrica, com identificação e quantidade do material.  OBSERVAÇÃO(ÕES): Atender à faixa "A" de eficiência energética da Etiqueta Nacional de Conservação de Energia (ENCE).

