POLTRONA (SOFÁ 01 LUGAR) // DESCRIÇÃO: sofá modular; composto por estrutura, assento, encosto e apoia-braço esquerdo.  CARACTERÍSTICA(S): 
. estrutura em madeira e percintas elásticas, revestidas de manta acrílica e acabada em suede ou chamois de poliéster lisa; face voltada para o chão coberta por tecido não-tecido; 
. assento com almofada fixa em espuma D33, com 7 cm de espessura, revestida de manta acrílica e acabada em suede ou chamois de poliéster lisa;
. encosto com almofada fixa em espuma D33, com 7 cm de espessura, revestida de manta acrílica e acabada em suede ou chamois de poliéster lisa;
. apoia-braço revestido em espuma D33, com 5 cm de espessura, revestida de manta acrílica e acabada em suede ou chamois de poliéster lisa.  MEDIDA(S): de 1000 mm x 750 mm x 850 mm aproximadamente, de largura x altura x profundidade (desenho em anexo).  COR(ES): bege claro.  GARANTIA MÍNIMA: 12 (doze) meses, contados da data do recebimento definitivo.  ACONDICIONAMENTO: em embalagem resistente e estanque.  OBSERVAÇÃO(ÕES): madeira de densidade superior a 500 kg/m³; percinta elástica de polipropileno e borracha; espuma flexível de poliuretano, densidades de 20 kg/m³ a 28 kg/m³; manta acrílica de poliéster; suede ou chamois de poliéster lisa, feltrada, com aplicação de impermeabilizante e repelente a líquidos e sujeiras; sem aplicações de madeira, metal, matelassado ou capitonê; sobre 4 pés de madeira maciça na cor "imbuia" com altura máxima de 4 cm; com conector metálico no lado esquerdo, para fixação ao módulo contíguo.

