FORNECIMENTO E INSTALAÇÃO DE ELEMENTO TÁTIL DE ALERTA
 // MARCA(S)/MODELO(S) DE REFERÊNCIA: ANDALUZ/ Linha Premium ou similar.  CARACTERÍSTICA(S): fornecimento e instalação de piso tátil de alerta formado por peças individuais aplicadas com gabarito, fixado sobre granito e piso vinílico.  MATERIAL(IS): elemento tátil em nylon industrial. Adesivo VHB 4930/ 3M (as peças já saem de fábrica com o adesivo fixado). As peças deverão receber um primer na base para melhor fixação do adesivo.  MEDIDA(S): diâmetro da base de 25 mm a 30 mm. Altura de 3 mm a 5 mm.
