ESTAÇÃO DE EDIÇÃO NÃO-LINEAR DE VÍDEO // MARCA(S)/MODELO(S) DE REFERÊNCIA: DELL/PRECISION 3660; HP/Z2 G9; LENOVO/P360.  APLICAÇÃO: Pós-produção de vídeos e documentários pela TV Câmara  CARACTERÍSTICA(S): Estação de Edição Não-Linear de Vídeo, com as seguintes características técnicas: 
.especificações do hardware:
-gabinete do tipo torre; 
-configuração mínima com 01 (um) processador físico com tecnologia Intel Core i7 12700 12ª geração, arquitetura “Alder Lake”, dodeca-core, frequência de núcleo mínima de 2.1 (dois ponto um) GHz em modo normal e 4.9 (quatro ponto nove) GHz em modo turbo;- cache L3 de, pelo menos, 25 (vinte e cinco) Megabytes ou processador similar com índice de processamento Passmark CPU Benchmark (https://www.cpubenchmark.net) de, no mínimo, 20712 (vinte mil, setecentos e doze) pontos;
-memória principal de, pelo menos, 64 (sessenta e quatro) Gbytes de RAM, com memórias do tipo DDR4-3200 MHz;
-deverá possuir placa de vídeo do tipo PCI-E profissional (modelo Nvidia Ampère RTX A2000 ou superior) com saída digital de vídeo quádrupla mini DisplayPort  com, pelo menos, 6 (seis)  Gbytes de memória exclusiva do tipo GDDR6 ou superior (não compartilhada com a memória principal), barramento de 192 bits ou superior e suporte ao processamento do tipo GPU (CUDA ou similar) ;
-deverá possuir placa de som interna acompanhada de alto falantes externos ativos para monitoração do áudio;
-deverá possuir unidade de disco principal, padrão estado sólido NVME Gen4, para instalação do sistema operacional, com pelo menos 1 (um) Terabyte de capacidade;
-deverá possuir 1 (uma) unidade adicional de disco padrão estado sólido NVME Gen4, com pelo menos 1 (um) Terabyte de capacidade;
-deverá possuir sistema adicional de armazenamento padrão SATA6 (6 Gbps) composto de, pelo menos, 2 (dois) discos de capacidade mínima de 8 (oito) Terabytes com velocidade rotacional de 7200 (sete mil e duzentas) RPM ; 
-deverá possuir 01 (uma) interface de rede padrão Gigabit Ethernet, terminada em conector RJ45 e com atendimento ao padrão 1000BASE-T;
-deverá possuir interface padrão USB 3.2 Gen.2 10 GBps; 
-deverá possuir leitor de cartão de memória SD;
-deverá possuir fonte de alimentação dimensionada com chaveamento automático de voltagem de entrada com PFC mínimo de 90 (noventa) por cento e acompanhada de cabo de alimentação com conector padrão NBR 14136; 
-deverá ser acompanhada de 2 (dois) monitores de vídeo profissionais com display do tipo LCD, razão de aspecto widescreen (16:9), 27 (vinte e sete) polegadas de diagonal, resolução nativa de Quad HD (2560x1440 pixels), pré-calibrados de fábrica, com retroiluminação a LED e painel do tipo IPS (in-plane switching) e que permita ajuste de cores segundo padrões SMPTE, acompanhados de base, suporte de mesa com ajuste de altura, cabo de alimentação com conector padrão NBR 14136 e cabos DisplayPort/ MiniDisplay Port para interligação à placa de vídeo fornecida;
-deverão ser fornecidos 2 (dois) adaptadores mini DisplayPort para HDMI 2.0 4k/60 para interligação à placa de vídeo fornecida;
-deverá possuir teclado e mouse USB compatíveis, sendo o mouse do tipo ótico com sensor de movimento baseado em laser e o teclado padrão ABNT-2; 
-sistema operacional Windows 10 Workstation instalado, com licença perpétua emitida em nome da Câmara dos Deputados. Se,  no  momento  da  entrega,  a versão  solicitada  não  for  a  padrão  fornecida  pelo  fabricante,  deve-se  fornecer  a licença da versão mais recente, com direito de downgrade para a versão Windows 10 Workstation.
-os modelos dos equipamentos ofertados deverão obedecer aos requisitos estabelecidos na norma IEEE 1680, implementados pelo selo EPEAT (Electronic Product Environmental Assessment Tool), da agência de proteção ambiental (EPA), na categoria GOLD ou superior, comprovando que o equipamento cumpre as exigências para controle do impacto ambiental em seu processo de fabricação.
-a comprovação do enquadramento à referida norma poderá ser o registro do modelo do equipamento no site http://www.epeat.net, ou, então, a apresentação de certificado ou relatório de avaliação de conformidade emitido por órgão credenciado pelo INMETRO ou certificado internacional similar, c

