LOCAÇÃO DE CABINE PARA TRADUÇÃO SIMULTÂNEA // APLICAÇÃO: para eventos institucionais promovidos pela Câmara dos Deputados.  CARACTERÍSTICA(S):  - permitir uma boa comunicação visual e auditiva entre os intérpretes e os conferencistas; 
- proporcionar condições de trabalho adequadas que permitam aos tradutores manter os níveis de concentração exigidos durante todo o dia de trabalho; 
- facilitar, por meio de uma construção ligeira mas robusta, o respectivo manuseio e a montagem;
- deve possuir dimensões mínimas de 2 metros de fundo x 2 metros de frente x 2 metros de altura e porta de entrada e saída que permita a troca do(s) tradutor(es) com a agilidade necessária ;
- deve possuir isolamento acústico de alta qualidade de modo que a tradução que está sendo feita não interfira com a plateia bem como isolar os tradutores para que possam receber com clareza a fala do palestrante, no volume apropriado;
- deve possibilitar a renovação contínua do ar, preservando as condições de salubridade;
- deve ser fornecida com bancada para instalação dos equipamentos e cadeiras;
- deve ser fornecida com sistema de iluminação para utilização dos tradutores;
- deve possuir pontos de conexão à rede elétrica fornecida pela Contratante;
- deve atender completamente as normas ISO 2603 e ISO 4043. 
  CARGA HORÁRIA: diária de 12 (doze) horas.

LOCAÇÃO DE CONSOLE PARA TRADUÇÃO SIMULTÂNEA // DESCRIÇÃO: conjunto de console de interpretação (mesa) com transmissor para cada língua estrangeira, com 2 (dois) microfones e 2 (dois) fones de ouvido.  CARACTERÍSTICA(S):  DO CONSOLE DE INTERPRETAÇÃO:
- deve possuir entrada de áudio oriundo da plateia (“floor”) terminada em conector fêmea XLR 
de três pinos, balanceada, com impedância de 600 Ohms, nível de linha e compatível com o sistema de distribuição de som da Contratante;
- deve ter capacidade de chaveamento automático do sinal de entrada "floor" para as saídas quando o intérprete desligar o seu microfone; 
- deve possuir controle de ganho do sinal da entrada floor; 
- deve possuir saída de áudio terminada em conector fêmea XLR de três pinos, balanceada, com impedância de 600 Ohms, nível de linha e compatível com o sistema de distribuição de som da Contratante; 
- deve ser isento de distorções; 
- eventuais ruídos não deverão afetar a compreensão do discurso; 
- interferência "cross-talk" entre canais (nos terminais de fones de ouvidos dos tradutores) deverão ser inexistentes ou imperceptíveis; 
- deve possuir chave “muting” (silenciador); 
- deve possibilitar a seleção de canais de saída e entrada; 
- deve possuir controle de volume para ajuste dos níveis de audição; 
- deve possuir saída para fones de ouvido ou "head set" totalmente compatível com o(s) fone(s) de ouvido fornecido(s); 
- deve possuir chave de linha interna de comunicação "messenger"; 
- deve permitir a tradução simultânea de até 2 idiomas diferentes.

DO TRANSMISSOR SEM FIO:
- deve operar na faixa de frequência UHF ou FM, com possibilidade de seleção de frequências a serem utilizadas de modo a minimizar eventuais interferências no local do evento;
- alcance mínimo de 300 metros;
- antenas e cabeamento deverão ser fornecidos pela Contratada;
- deve ser homologado pela Anatel, a fim de utilizar a faixa de frequência apropriada e trabalhar em níveis seguros de irradiação eletromagnética;
- totalmente compatível com os demais equipamentos fornecidos.
DOS FONES DE OUVIDOS E MICROFONES:
- deverão ser de categoria profissional, destinados especificamente para este tipo de aplicação;
- totalmente compatíveis com os demais equipamentos fornecidos.  OBSERVAÇÃO(ÕES):  Deverá ser fornecido um técnico/operador para acompanhar o evento no local, preparado para atender a quaisquer emergências. 
  CARGA HORÁRIA: diária de 12 (doze) horas.

LOCAÇÃO DE RECEPTORES E FONES PARA TRADUÇÃO SIMULTÂNEA // CARACTERÍSTICA(S):  - deve ser de categoria profissional e de alta fidelidade;
- a transmissão deverá ser sem fio via radiofrequência;
- possibilidade de recepção de, pelo menos, seis canais diferentes;
- deve possuir chave para ajuste do canal a ser recebido, com indicação visual do canal sintonizado;
- deve possuir controle de volume da saída de fone de ouvido;
- as baterias e/ou pilhas utilizadas nos receptores deverão ser fornecidas pela Contratada, sendo de sua responsabilidade o eventual descarte conforme as normas ambientais;
- devem ser utilizados fones de ouvido descartáveis para os receptores ou serem substituídas as espumas auriculares, antes de cada evento;
- deve ser homologado pela Anatel, a fim de utilizar a faixa de frequência apropriada e trabalhar em níveis seguros de irradiação eletromagnética.
  OBSERVAÇÃO(ÕES): deverá ser totalmente compatível com os demais equipamentos fornecidos no item 11 (LOCAÇÃO DE CONJUNTO DE CONSOLE DE INTERPRETAÇÃO - MESA - COM TRANSMISSOR).

GERADOR INSERSOR DE LEGENDAS OCULTAS ("CLOSED CAPTION") // MARCA(S)/MODELO(S) DE REFERÊNCIA: marca Eitv modelo LR CC INSERTER; marca Showcase Pro modelo ENC35.  CARACTERÍSTICA(S): .para uso profissional;
.deve realizar a codificação de sinais de legendas ocultas ("closed captions") em sinais de vídeo digital banda base SDI;
.compatível com sinais SD-SDI, HD-SDI e 3G-SDI;
.compatível com padrões CEA608/708;
.deve receber os sinais de legenda oculta de fonte externa via porta ethernet e padrão IP;
